    "yfnwr-project-report-number-87-4-riverine-goose-study-yukon-flats-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the results of a
    preliminary effort towards aerial surveying riverine goose populations in 1985 and
    1986. The objective of the survey were to: determine the feasibility to observe
    and count goose broods and young from aircraft and to define survey conditions that
    support the maximum amount of data gathering for the minimum amount of effort; establish
    and maintain an annual survey for monitoring goose production trends; identify important
    goose production areas; and establish a data baseline to aid in analysis of habitat
    characteristics relating to goose production. The methods and results of the survey
    are discussed.",nt"license_title": "License Not Specified",nt"extras":
